import React from 'react'
import './App.css'
import SearchBar from './components/SearchBar/SearchBar.js'
import Info from './components/Info/Info.js'

class App extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      selectedCities: []
    }
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          <SearchBar placeholder="Enter a City Name" selectedCities={this.state} />
          <Info cities={this.state.selectedCities} />
        </header>
      </div>
    )
  }
}
export default App
